import React from 'react';

function VendorTable({ table }) {
  return (
    <div className="vendor-table">
      <h4>{table.name}</h4>
      <p>Status: {table.is_available ? 'Available' : 'Occupied'}</p>
    </div>
  );
}

export default VendorTable;
